import React, { memo } from 'react';

const Detail = ({ name, label, value, edit = false }) => {
  return (
    <div className='user-detail-page__detail'>
      <h6>{label || name}</h6>
      {!edit ? <h5>{value || `Your ${label}`}</h5> : <input value={value} />}
    </div>
  );
};

export default memo(Detail);
